import React, { useState, useEffect } from "react";

const Login = () => {

  const [message, setMessage] = useState("Hello World");

  return (
    <div class="container" style={{ margin: 10 }}>

      <div class="row" alignment="center" >
        <div class="col">
          <p
            style={{
              fontWeight: "bold"
            }}
          >Lists</p>
        </div>
      </div>

      <div class="row" alignment="center" >
        <div class="col">
          <input/>
        </div>
      </div>

    </div>
  )

}

export default Login;
